import { Container, Name, Username, Description, Id } from "./styles";

const UserDetails = (props) => (
    <Container>
        <Name>{props.name}</Name>
        <Id>{props.id}</Id>
        <Username>{props.login}</Username>
        <Description>{props?.html_url}</Description>
    </Container>
);

export default UserDetails;
